class App extends Component {
  constructor(){
    super();
    this.state = {
      arrayToSort : [],
      chartData : {}  
    };
  };

  render(){
    return (
      <div className="App">
        <Navbar />
        <GoogleChart id = "myChart" chartData = {this.state.chartData}/>
      </div>
    );
    }
  }
  export default App;
